import React from 'react';
import { Col, Row, Container } from 'reactstrap';
import Header from '../header';
import RandomChar from '../randomChar';
import ItemList from '../itemList';
import CharDetails from '../charDetails';
import styled from 'styled-components'
import './button.css'

// import gotServices from '../../Services'
const Button1 = styled.button`
position: relative;
display: inline-block;
padding: 5px 16px;
font-size: 14px;
font-weight: 500;
line-height: 20px;
white-space: nowrap;
vertical-align: middle;
cursor: pointer;
-webkit-user-select;
color:rgb(82, 179, 111);
`;
const Butick = () => {
    return (
        <>
            <Button1></Button1>
        </>
    )
}
const App = () => {
    const RandomChar1 = RandomChar


    return (
        <>
            <Container>
                <Header />
            </Container>
            <Container>

                <Row>
                    <Col lg={{ size: 5, offset: 0 }}>
                        <RandomChar1 />
                    </Col>
                </Row>
                <Butick />
                <Row>

                    <Col md='6'>
                        <ItemList />
                    </Col>
                    <Col md='6'>
                        <CharDetails />
                    </Col>
                </Row>
            </Container>
        </>
    );
};

export default App;
